					EXECUTIVE
				</ContainerTitreLine>
                <ContainerLine>
                <Travellers size={size.small} color={color.purple} />X4
                </ContainerLine>
                <ContainerLine>
                <Luggage size={size.small} color={color.purple} />X2
                </ContainerLine>
                <ContainerPrice >
				45.00€
